		<Table striped bordered>
			<thead>
				<tr>	
					<th colSpan="2">NO. {this.props.id})<h4>{this.props.title}</h4></th>
				</tr>
				<tr>
					<th>NAME: {this.props.writer}</th>
					<th>DATE: {this.props.time},  {this.props.date} </th>
				</tr>
				
			</thead>
